import React from "react";

const Note = () => {
  return (
    <div>
      <div class="row">
        <form class="col s12 center">
          <div class="row">
            <div class="input-field col s12">
              <textarea
                id="textarea2"
                class="materialize-textarea"
                data-length="120"
              />
              <label for="textarea2">Textarea</label>
            </div>
          </div>

          <button
            class="btn waves-effect waves-light"
            type="submit"
            name="action"
            style={{ background: "backgroundColor: #5D1049 !important" }}
          >
            Save
          </button>
        </form>
      </div>
    </div>
  );
};

export default Note;
